import React from "react";
import { Route, BrowserRouter } from "react-router-dom";

import Index from "../screens/index";

const Routes = () => {
   return(
       <BrowserRouter>
           <Route component = { Index }  path="/" exact />
       </BrowserRouter>
   )
}

export default Routes;
